import React from 'react';
import { Row, Col } from 'react-bootstrap';
import products from '../products';

function HomePage() {
	return (
		<div>
			<h1>Najnowsze produktu</h1>
			<Row>
				{products.map((product) => (
					<col sm={12} md={6} lg={4} xl={3}>
						<h3>{product.name}</h3>
					</col>
				))}
			</Row>
		</div>
	);
}

export default HomePage;
